import React from "react";
import ReactDOM from "react-dom";
import Header from "./Header";
import Footer from './Footer';
import Note from './Note';
import notes from '../notes';

const App = () => {
  return (
    <div>
      <Header />
      <Note title={notes.title} content={notes.content}/>
      <Footer />
    </div>
  );
};

export default App;
